template <typename T>
T ukaelNoise(T num) {
	uiRequired<T>();
	//TODO make check for 
	//uint8_t noise(uint16_t num) vs uint16_t noise(uint16_t num)
    if constexpr (sizeof(num) > 2 ) {
        uint sz = sizeof(num) << 1;
        num ^= num >> (num & sz) + 4;
        num *= 4763;
        num ^= num << (num & sz) + 4;
        return num;
    } else {
        num ^= num << 7;
        num *= 17;
        num ^= num >> 7;
        num ^= u8randomTable[num >> 8]; // num >> 8 for 256 table
        return num;
    }
}

