using namespace std;

string mpops(string pre, string sim) {
    int size = pre.size();
    char letter = pre[0];
    string sai = "";
    if(size > 1) {
        for(int i=0;i<size;i++) if(sim[i] == letter) {
                sai += mpops(pre.substr(1,i),sim.substr(0,i));
                sai += mpops(pre.substr(i+1,size-i-1),sim.substr(i+1,size-i-1));
                break;
            } 
    } return (sai += letter);
}

